import React from 'react';
import './custom-btn.style.scss';


const Custombtn = ({children,isGooglesignin, ...otherbtnprops}) =>(
    <button className={`${isGooglesignin? `google-signin` : `` } custom-button`} {...otherbtnprops}>
        {children}
    </button>
)

export default Custombtn;
